import  { createGlobalStyle }  from 'styled-components';

const GlobalStyle = (props: any) => createGlobalStyle`
body{
  padding:0;
  margin:0;
  background-color: #fee6b0;
  height: 100vh;
  border: solid 1px #000;
}
`
export default GlobalStyle ;
